package com.amandris.clients.web.form;import java.io.Serializable;import org.apache.struts.validator.ValidatorForm;public class AdminCensorVoteForm extends ValidatorForm implements Serializable{	private String id;	private String buyerLogin;	private String sellerLogin;	private String comment;	private String reply;	private String vote;		private static final long serialVersionUID = 14886326121456014L;	public String getBuyerLogin() {		return buyerLogin;	}	public void setBuyerLogin(String buyerLogin) {		this.buyerLogin = buyerLogin;	}	public String getComment() {		return comment;	}	public void setComment(String comment) {		this.comment = comment;	}	public String getId() {		return id;	}	public void setId(String id) {		this.id = id;	}	public String getReply() {		return reply;	}	public void setReply(String reply) {		this.reply = reply;	}	public String getSellerLogin() {		return sellerLogin;	}	public void setSellerLogin(String sellerLogin) {		this.sellerLogin = sellerLogin;	}	public String getVote() {		return vote;	}	public void setVote(String vote) {		this.vote = vote;	}	}